    const alertClicked = () => {
        alert('You clicked the third ListGroupItem');
    };

    return (

        <ListGroup defaultActiveKey="#link1">
            {items.map((item, index) => (
            <ListGroup.Item action href="#link1">
                Коммутатор 1
            </ListGroup.Item>
            ))}
        </ListGroup>

    );
}

export default ServerList;
